function FDsSceneCanvas_onMouseCaptureStart(p){
   var o = this;
   var s = o._activeScene;
   if(!s){
      return;
   }
   var r = o._activeScene.region();
   var st = RConsole.find(FG3dTechniqueConsole).find(o._graphicContext, FG3dSelectTechnique);
   var r = st.test(r, p.offsetX, p.offsetY);
   o.selectRenderable(r);
   o._capturePosition.set(p.clientX, p.clientY);
   o._captureRotation.assign(s.camera()._rotation);
   if(r){
      var d = r.display();
      o._captureMatrix.assign(d.matrix());
   }
}
function FDsSceneCanvas_onMouseCapture(p){
   var o = this;
   var s = o._activeScene;
   if(!s){
      return;
   }
   var cx = p.clientX - o._capturePosition.x;
   var cy = p.clientY - o._capturePosition.y;
   var mc = o._canvasModeCd;
   var mv = o._canvasMoveCd;
   var cm = o._captureMatrix;
   var sm = null;
   var sr = o._selectRenderable;
   if(sr){
      var sd = sr.display();
      sm = sd.matrix();
   }
   switch(mc){
      case EDsCanvasMode.Drop:
         var c = o._activeScene.camera();
         var r = c.rotation();
         var cr = o._captureRotation;
         r.x = cr.x + cy * 0.003;
         r.y = cr.y + cx * 0.003;
         break;
      case EDsCanvasMode.Select:
         break;
      case EDsCanvasMode.Translate:
         if(sr){
            if(mv == EDsCanvasDrag.X){
               sm.tx = cm.tx + cx / 10;
            }else if(mv == EDsCanvasDrag.Y){
               sm.ty = cm.ty + -cy / 10;
            }else if(mv == EDsCanvasDrag.Z){
               sm.tz = cm.tz + cx / 10;
            }
         }
         break;
      case EDsCanvasMode.Rotation:
         if(sr){
            if(mv == EDsCanvasDrag.X){
               sm.rx = cm.rx + cx / 10;
            }else if(mv == EDsCanvasDrag.Y){
               sm.ry = cm.ry + -cy / 10;
            }else if(mv == EDsCanvasDrag.Z){
               sm.rz = cm.rz + cx / 10;
            }
         }
         break;
      case EDsCanvasMode.Scale:
         if(sr){
            if(mv == EDsCanvasDrag.X){
               sm.sx = cm.sx + cx / 10;
            }else if(mv == EDsCanvasDrag.Y){
               sm.sy = cm.sy + -cy / 10;
            }else if(mv == EDsCanvasDrag.Z){
               sm.sz = cm.sz + cx / 10;
            }else if(mv == EDsCanvasDrag.All){
               sm.sx = cm.sx + cx / 10;
               sm.sy = cm.sy + cx / 10;
               sm.sz = cm.sz + cx / 10;
            }
         }
         break;
   }
   if(sm){
      sm.updateForce();
      if(o._templateFace){
         var tm = o._templateFace.matrix();
         tm.assign(sm);
         tm.setScaleAll(o._templateViewScale);
         tm.update();
      }
   }
}
